/**
 * The type of knockout to use on a page item
 *
 * @since CS2
 * @version CS2
 *
 * <b>enum</b>
 * ･ {@link DISABLED}
 * ･ {@link ENABLED}
 * ･ {@link INHERITED}
 * ･ {@link Unknown}
 */
declare class KnockoutState
{
	/**
	 * @static
	 * @const
	 * @type {KnockoutState}
	 * @see {@link KnockoutState}
	 * @since CS2
	 * @version CS2
	 */
	static readonly DISABLED:KnockoutState;

	/**
	 * @static
	 * @const
	 * @type {KnockoutState}
	 * @see {@link KnockoutState}
	 * @since CS2
	 * @version CS2
	 */
	static readonly ENABLED:KnockoutState;

	/**
	 * @static
	 * @const
	 * @type {KnockoutState}
	 * @see {@link KnockoutState}
	 * @since CS2
	 * @version CS2
	 */
	static readonly INHERITED:KnockoutState;

	/**
	 * @static
	 * @const
	 * @type {KnockoutState}
	 * @see {@link KnockoutState}
	 * @since CS2
	 * @version CS2
	 */
	static readonly Unknown:KnockoutState;
}